  function emsav(x,c) result(v)
    implicit none
    real(wp),dimension(1:36)::x
    real(wp),dimension(0:13229)::p
    real(wp),dimension(0:13229)::c
    real(wp)::v
    
    call bemsav(x,p)
    v = dot_product(p,c)
    
    return
  end function emsav
  
  subroutine bemsav(x,p)
    implicit none
    real(wp),dimension(1:36)::x
